window.bookSummaryJSON = "<p><b>Hugo Award Winner for Best Series</b></p> <p>The second book in the <i>NYT</i> best-selling Expanse series, <i>Caliban's War</i> shows a solar system on the brink of war, and the only hope of peace rests on James Holden and the crew of the Rocinante's shoulders. Now a Prime Original series.</p> <p>We are not alone.</p> <p>On Ganymede, breadbasket of the outer planets, a Martian marine watches as her platoon is slaughtered by a monstrous supersoldier. On Earth, a high-level politician struggles to prevent interplanetary war from reigniting. And on Venus, an alien protomolecule has overrun the planet, wreaking massive, mysterious changes and threatening to spread out into the solar system.</p> <p>In the vast wilderness of space, James Holden and the crew of the Rocinante have been keeping the peace for the Outer Planets Alliance. When they agree to help a scientist search war-torn Ganymede for a missing child, the future of humanity rests on whether a single ship can prevent an alien invasion that may have already begun...</p> <p><b>The Expanse</b></p> <p></p> <ul> <li><i>Leviathan Wakes</i></li> <li><i>Caliban's War</i></li> <li><i>Abaddon's Gate</i></li> <li><i>Cibola Burn</i></li> <li><i>Nemesis Games</i></li> <li><i>Babylon's Ashes</i></li> <li><i>Persepolis Rising</i></li> <li><i>Tiamat's Wrath</i></li> <li><i>​Leviathan Falls</i></li> <li><i>Memory's Legion</i></li> </ul> <p><b>The Expanse Short Fiction</b></p> <p></p> <ul> <li><i>Drive</i></li> <li><i>The Butcher of Anderson Station</i></li> <li><i>Gods of Risk</i></li> <li><i>The Churn</i></li> <li><i>The Vital Abyss</i></li> <li><i>Strange Dogs</i></li> <li><i>Auberon</i></li> <li><i>The Sins of Our Fathers</i></li> </ul>"; 
